window.bookSummaryJSON = "<p>The Kingdom of Zangaria has fallen into civil war. On one side, King Randor and his forces, determined to impose his rule over the entire kingdom; on another, the noblemen who want to crush the king; on a third, Princess Alassa and the Levellers.&nbsp;</p> <p>Caught in the middle, Emily must steer a course between her loyalty to her friend, her duty to people who put their faith in her, and her fears for the future.&nbsp;</p> <p>But King Randor has unleashed forces even he may be unable to control....</p>"; 
